import axios from "axios"
export const ADD_DATA = "ADDDATA"
export const ADD_CATEGORIES = "ADDCATEGORIES"

const getUser = () => {
	return (dispatch: any) => {
		dispatch({ type: ADD_DATA })
		return axios.get(`https://api.thecatapi.com/v1/images/search?limit=10&page=1`)
			.then(cats => dispatch({ type: ADD_DATA, cats }))
	}
}
